import React, { PureComponent } from "react";
import { Chart } from "react-google-charts";
import Card from "pnnl-react-core/lib/Card";

class LCSGoogleGraph extends PureComponent {
  constructor(props) {
    super(props);
    var lcs = this.props.data;

    this.data = [
      ["Huebin-Angle", "Local-Chroma Shift", { role: "style" }],
      ["1", lcs[0], "color: #b45c60"],
      ["2", lcs[1], "color: #cb7761"],
      ["3", lcs[2], "#cb824b"],
      ["4", lcs[3], "#d7ad67"],
      ["5", lcs[4], "#ac9a5d"],
      ["6", lcs[5], "#919E60"],
      ["7", lcs[6], "#678B5F"],
      ["8", lcs[7], "#62B08F"],
      ["9", lcs[8], "#7CBABA"],
      ["10", lcs[9], "#2C797D"]
    ];

    //this.data = [

    //]
  }

  render() {
    return (
      <Card>
        <Chart
          width={"800px"}
          height={"300px"}
          chartType="Bar"
          loader={<div>Loading Chart</div>}
          data={this.data}
          options={{
            chart: {
              title: "Company Performance",
              subtitle: "Sales, Expenses, and Profit: 2014-2017"
            },
            legend: { position: "none" }
          }}
          // For tests
          rootProps={{ "data-testid": "4" }}
        />
      </Card>
    );
  }
}

export default LCSGoogleGraph;
